import "./App.css";
import LandingPage from "./Pages/landing-page.jsx";
import { BrowserRouter as Router, Route,} from 'react-router-dom';
import { Navbar } from "./Components/Navbar/Navbar";

function App() {
    return (

        <div className="App">
            <Navbar />
                <Route path = "/home">
                    <LandingPage />
                </Route>
                <Route path = "/"></Route>
        </div>
    );
}

export default App;
